{"metadata":{"kernelspec":{"name":"ir","display_name":"R","language":"R"},"language_info":{"name":"R","codemirror_mode":"r","pygments_lexer":"r","mimetype":"text/x-r-source","file_extension":".r","version":"4.0.5"}},"nbformat_minor":4,"nbformat":4,"cells":[{"source":"<a href=\"https://www.kaggle.com/ghazalkhalili/exploratory-data-analysis-on-chocolate-bars?scriptVersionId=84615847\" target=\"_blank\"><img align=\"left\" alt=\"Kaggle\" title=\"Open in Kaggle\" src=\"https://kaggle.com/static/images/open-in-kaggle.svg\"></a>","metadata":{},"cell_type":"markdown","outputs":[],"execution_count":0},{"cell_type":"markdown","source":"# Exploratory Data Analysis on Chocolate Bars","metadata":{"_uuid":"e590bb57-9910-43a9-bf42-359872553e22","_cell_guid":"3c2d6c4f-88ac-4568-8236-a9020458e82a","trusted":true}},{"cell_type":"markdown","source":"<!-- TOC depthFrom:2 -->\n\n## Table of Contents\n\n- [Introduction](#Introduction)\n- [A Brief exploratory data analysis](#brief_exploratory)\n  - [Bar plot of the top 10 producers considering the number of ingredients](#Barplot)\n  - [Scatter plot of changes in the ratings](#Scatterplot)\n  - [Violin plot of the rating distribution](#Violinplot)\n- [Shiny App](#ShinyApp)\n- [Feedback](#Feedback)\n\n\n<!-- /TOC -->","metadata":{}},{"cell_type":"markdown","source":"<a id=\"Introduction\" name=\"Introduction\"></a>\n# Introduction\nThe data is retrieved from the [Chocolate Bar 2020 Kaggle repository](https://www.kaggle.com/soroushghaderi/chocolate-bar-2020).\n    This dataset has information on 2,224 expert ratings of over 1,700 individual chocolate bars, collected from 2006 to 2020.\n    It also includes some other information on the chocolate, such as company name, the origin country of beans, and cocoa percent. The rating scale is from 1 (Unpleasant) to 5 (Outstanding). We wish to explore the dataset, and make a simple Shiny app.","metadata":{"_uuid":"9cbb8238-8637-47ed-851f-299487023017","_cell_guid":"340fe4f5-1231-4c77-a622-2337e0c8631e","trusted":true}},{"cell_type":"code","source":"# Loading packages\nlibrary(ggplot2)\nlibrary(magrittr)\nlibrary(dplyr)\nlibrary(pheatmap)\nlibrary(tidyr)\nlibrary(readr)\nlibrary(textshape)\nlibrary(knitr)\nlibrary(xtable)\n\n# Reading the data\nchoco = read.csv(\"../input/chocolate-bar-2020/chocolate.csv\", stringsAsFactors = T)\nchoco = choco %>% select(-c(X, ref)) %>% mutate(counts_of_ingredients = as.factor(counts_of_ingredients))\nstr(choco)","metadata":{"_uuid":"b987581a-5eb1-48d9-b544-29565896b011","_cell_guid":"8ad50c6f-2c2c-4e50-9ca6-5f3bb429eaa5","collapsed":false,"jupyter":{"outputs_hidden":false},"execution":{"iopub.status.busy":"2022-01-03T19:28:37.00687Z","iopub.execute_input":"2022-01-03T19:28:37.053294Z","iopub.status.idle":"2022-01-03T19:28:37.93433Z"},"_kg_hide-output":true,"trusted":true},"execution_count":null,"outputs":[]},{"cell_type":"markdown","source":"<a id=\"brief_exploratory\" name=\"A brief exploratory data analysis\"></a>\n# A brief exploratory data analysis\nThe raw dataset has 21 columns, and most of them are categorical variables. So, we changed the type of them into factors. We also removed two first columns, which are not useful.\n    [Table 1](#VarType) shows the data types of variables. Also, [table 2](#SStatistics) gives a brief overview of the variables' statistics.","metadata":{"_uuid":"79fbcc55-69c6-4773-839b-c636b331868b","_cell_guid":"4b93ab54-8df7-4033-83bc-ab9b83a527ac","trusted":true}},{"cell_type":"code","source":"VNames = colnames(choco)\nNObserv = nrow(choco)\nCol_type = sapply(choco, class)\ntbbl = as_tibble(data.frame(VNames, Col_type))\n#xtable::xtable(tbbl) # We could also used xtable to generate a table\nknitr::kable(tbbl, caption = \"Table of Variables' Type\", align = \"lc\") \ncat(\"Number of Observations is \", NObserv)\nknitr::kable(summary(choco), caption = \"Table of Summary Statistics\") ","metadata":{"_uuid":"e3ba2e99-c20e-46ce-a9b7-7125ac20f196","_cell_guid":"98f0284f-c776-4025-b122-0e5cb3dad6ca","collapsed":false,"jupyter":{"outputs_hidden":false},"execution":{"iopub.status.busy":"2022-01-03T19:28:37.938114Z","iopub.execute_input":"2022-01-03T19:28:37.93987Z","iopub.status.idle":"2022-01-03T19:28:38.020671Z"},"_kg_hide-output":true,"trusted":true},"execution_count":null,"outputs":[]},{"cell_type":"markdown","source":"<a id=\"VarType\" name=\"Variables' Type\"></a>\n#### Table 1. Variables' Type\n\n|VNames                           | Col_type |\n|:--------------------------------|:--------:|\n|company                          |  factor  |\n|company_location                 |  factor  |\n|review_date                      | integer  |\n|country_of_bean_origin           |  factor  |\n|specific_bean_origin_or_bar_name |  factor  |\n|cocoa_percent                    | numeric  |\n|rating                           | numeric  |\n|counts_of_ingredients            |  factor  |\n|beans                            |  factor  |\n|cocoa_butter                     |  factor  |\n|vanilla                          |  factor  |\n|lecithin                         |  factor  |\n|salt                             |  factor  |\n|sugar                            |  factor  |\n|sweetener_without_sugar          |  factor  |\n|first_taste                      |  factor  |\n|second_taste                     |  factor  |\n|third_taste                      |  factor  |\n|fourth_taste                     |  factor  |","metadata":{}},{"cell_type":"markdown","source":"<a id=\"SStatistics\" name=\"Summary of Statistics\"></a>\n#### Table 2. Summary of Statistics\n\n|   |    company   |company_location | review_date |       country_of_bean_origin |  specific_bean_origin_or_bar_name |cocoa_percent  |    rating    |counts_of_ingredients |      beans    |               cocoa_butter |           vanilla   |             lecithin  |           salt    |           sugar    |                    sweetener_without_sugar | first_taste | second_taste | third_taste | fourth_taste |\n|:--|:-------------|:----------------|:------------|:-----------------------------|:----------------------------------|:--------------|:-------------|:---------------------|:--------------|:---------------------------|:--------------------|:----------------------|:------------------|:-------------------|:-------------------------------------------|:------------|:-------------|:------------|:-------------|\n|   |Soma    :  52 |U.S.A  :948      |Min.   :2006 |Venezuela         : 238       |Madagascar        :  52            |Min.   : 42.00 |Min.   :1.000 |1:  5                 |have_bean:2224 |have_cocoa_butter    :1535  |have_not_vanila:1876 |have_lecithin    : 479 |have_not_salt:2187 |have_not_sugar:  82 |have_not_sweetener_without_sugar:2148       |creamy : 160 |sweet  : 115  |: 620        |:1982         |\n|   |Arete   :  32 |France :167      |1st Qu.:2011 |Peru              : 207       |Ecuador           :  38            |1st Qu.: 70.00 |1st Qu.:3.000 |2:665                 |NA             |have_not_cocoa_butter: 689  |have_vanila    : 348 |have_not_lecithin:1745 |have_salt    :  37 |have_sugar    :2142 |have_sweetener_without_sugar    :  76       |sandy  : 128 |nutty  :  83  |cocoa  :  94 |cocoa  :  16  |\n|   |Fresco  :  31 |Canada :158      |Median :2014 |Dominican republic: 200       |Peru              :  36            |Median : 70.00 |Median :3.250 |3:909                 |NA             |NA                          |NA                   |NA                     |NA                 |NA                  |NA                                          |intense:  81 |:  77         |nutty  :  70 |roasty :  16  |\n|   |Bonnat  :  28 |U.k.   :117      |Mean   :2014 |Ecuador           : 194       |Dominican Republic:  35            |Mean   : 71.49 |Mean   :3.199 |4:450                 |NA             |NA                          |NA                   |NA                     |NA                 |NA                  |NA                                          |nutty  :  76 |earthy :  70  |roasty :  69 |sour   :  13  |\n|   |Pralus  :  26 |Italy  : 67      |3rd Qu.:2016 |Madagascar        : 157       |Chuao             :  25            |3rd Qu.: 74.00 |3rd Qu.:3.500 |5:191                 |NA             |NA                          |NA                   |NA                     |NA                 |NA                  |NA                                          |fatty  :  74 |roasty :  65  |sour   :  62 |rich   :  11  |\n|   |A. Morin:  25 |Belgium: 56      |Max.   :2020 |Blend             : 140       |Venezuela         :  19            |Max.   :100.00 |Max.   :4.000 |6:  4                 |NA             |NA                          |NA                   |NA                     |NA                 |NA                  |NA                                          |sweet  :  69 |cocoa  :  64  |earthy :  48 |earthy :  10  |\n|   |(Other) :2030 |(Other):711      |NA           |(Other)           :1088       |(Other)           :2019            |NA             |NA            |NA                    |NA             |NA                          |NA                   |NA                     |NA                 |NA                  |NA                                          |(Other):1636 |(Other):1750  |(Other):1261 |(Other): 176  |\n\n","metadata":{}},{"cell_type":"markdown","source":"Due to the large number of producer companies in the dataset, we narrow down our study. So, we select the top 10 companies with the most frequency in the dataset. Using this smaller dataset, we plot three different graphs.","metadata":{}},{"cell_type":"code","source":"freq_Origin = as.data.frame(table(choco$company))\ncolnames(freq_Origin) = c(\"Company\", \"Frequency\")\n\n# The top 10 chocolate bar producers\ntop10s = dplyr::arrange(freq_Origin, desc(Frequency))[1:10,]\nonlytops = dplyr::filter(choco, company %in% top10s[,1]) \n\n# Saving the data with modified data types for GitHub repository, used in Shinyapp\nwrite.csv(onlytops,\"Top10Choco.csv\", row.names = FALSE)","metadata":{"execution":{"iopub.status.busy":"2022-01-03T19:28:38.023574Z","iopub.execute_input":"2022-01-03T19:28:38.025541Z","iopub.status.idle":"2022-01-03T19:28:38.064162Z"},"_kg_hide-output":true,"trusted":true},"execution_count":null,"outputs":[]},{"cell_type":"markdown","source":"<a id=\"Barplot\" name=\"Bar plot of the top 10 producers considering the number of ingredients used\"></a>\n## 1. Bar plot of the top 10 producers considering the number of ingredients used\n[Figure 1](#Barplot1) shows the total number of chocolate bars of each company, considering the different number of ingredients used in the chocolate bars. We can see that the most frequent producer uses only three ingredients in all of their bars. Generally, most of the companies prefer to use three ingredients, which is evident in the summary statistics of the related variable (”counts of ingredients” column in [table 2](#VarType)).","metadata":{}},{"cell_type":"code","source":"# Plotting\nggplot(onlytops, aes(x = company, fill = counts_of_ingredients)) + geom_bar() +\n  theme_bw() + scale_fill_manual(values = c(\"2\" = \"#880E4F\", \"3\" = \"#FFF176\",\n                               \"4\" = \"#64B5F6\", \"5\" = \"#7E57C2\"))","metadata":{"_uuid":"ec509049-5bc8-425e-8a0a-43161f184f9e","_cell_guid":"27b3d462-97e5-4b37-88cc-f590a5805e3b","collapsed":false,"jupyter":{"outputs_hidden":false},"execution":{"iopub.status.busy":"2022-01-03T19:28:38.067381Z","iopub.execute_input":"2022-01-03T19:28:38.069278Z","iopub.status.idle":"2022-01-03T19:28:38.7119Z"},"_kg_hide-output":true,"trusted":true},"execution_count":null,"outputs":[]},{"cell_type":"markdown","source":"<a id=\"Barplot1\" name=\"bar plot of top ten\"></a>\n![bar plot.png](attachment:8dfd4b0e-205a-4a77-a8a3-87e9637af394.png)\n#### Fgiure 1. Bar plot of the top 10 chocolate bar producers considering number of ingredients used","metadata":{},"attachments":{"8dfd4b0e-205a-4a77-a8a3-87e9637af394.png":{"image/png":""}}},{"cell_type":"markdown","source":"<a id=\"Scatterplot\" name=\"Scatter plot of changes in the ratings\"></a>\n## 2. Scatter plot of changes in the ratings of chocolate bars (2006-2020)\n[Figure 2](#Scatterplot2) is a scatter plot representing the overall trend in the ratings of companies over the years. Each box in the graph shows the changes in the ratings of the company’s bars. We can see that in some years, there were several ratings reported for different chocolate bars of a company, and the worst rating was for Valrhona company in the year 2007.","metadata":{}},{"cell_type":"code","source":"ggplot(onlytops, aes(x = review_date, y = rating, color = company)) + \n  geom_point()  + facet_wrap(~ company, nrow = 2) + geom_line() +theme_bw() +\n  scale_x_continuous(breaks = seq(2005,2021,2), guide = guide_axis(angle = 90))","metadata":{"execution":{"iopub.status.busy":"2022-01-03T19:28:38.714479Z","iopub.execute_input":"2022-01-03T19:28:38.715963Z","iopub.status.idle":"2022-01-03T19:28:39.810064Z"},"_kg_hide-output":true,"trusted":true},"execution_count":null,"outputs":[]},{"cell_type":"markdown","source":"<a id=\"Scatterplot2\" name=\"scatter plot of top ten\"></a>\n![scatter plot.png](attachment:b8fd6d21-fa74-4820-9dff-d1a636072f07.png)\n#### Fgiure 2. Changes in the ratings of companies’ chocolate bars from 2006 to 2020","metadata":{},"attachments":{"b8fd6d21-fa74-4820-9dff-d1a636072f07.png":{"image/png":""}}},{"cell_type":"markdown","source":"<a id=\"Violinplot\" name=\"Violin plot of the rating distribution\"></a>\n## 3. Violin plot of the distribution of ratings\n[Figure 3](#Violinplot3) is a violin plot showing the rating distribution of the top companies. While some companies such as Arete and Domori have a distribution close to normal, others have none of the popular distributions.","metadata":{}},{"cell_type":"code","source":"ggplot(onlytops, aes(x = company, y = rating)) + geom_violin() +\n  geom_boxplot(width=0.1, fill=\"white\") +theme_bw()","metadata":{"execution":{"iopub.status.busy":"2022-01-03T19:28:39.812752Z","iopub.execute_input":"2022-01-03T19:28:39.814195Z","iopub.status.idle":"2022-01-03T19:28:40.388946Z"},"_kg_hide-output":true,"trusted":true},"execution_count":null,"outputs":[]},{"cell_type":"markdown","source":"<a id=\"Violinplot3\" name=\"Violin plot of top ten\"></a>\n![violin plot.png](attachment:edaa9d48-4bfd-4b70-8a72-1088dae39571.png)\n#### Figure 3. A compact display of the rating deistribution of companies","metadata":{},"attachments":{"edaa9d48-4bfd-4b70-8a72-1088dae39571.png":{"image/png":""}}},{"cell_type":"markdown","source":"<a id=\"ShinyApp\" name=\"Shiny App\"></a>\n# A Shiny App\nFinally, we prepare a shiny app that provides two choices for the user. If the review date is chosen, the app plots [Figure 2](#Scatterplot2). Otherwise, [Figure 3](#Violinplot3) is displayed to the user. The shiny app is accessible via [my shinyapps](https://g-khalili.shinyapps.io/Ghazal-choco_bars/).","metadata":{}},{"cell_type":"code","source":"# Reloading packages\nlibrary(ggplot2)\nlibrary(shiny)\nlibrary(bslib)\n\n# Reading our data\nNewChoco = read.csv(\"https://raw.githubusercontent.com/Ghzlikli/top_ten_chocolate_bars/main/Top10Choco.csv\")\n\nui <- shiny::fluidPage(\n  # Using a dark theme for UI\n  theme = bs_theme(bootswatch = \"darkly\"),\n  titlePanel(\"Top Ten Chocolate Bar Producers Shiny App\"),\n  selectInput(inputId = \"x_var\", \n              label = \"Choose a variable for x axis\", \n              choices = c(\"company\", \"review_date\"),\n              selected  = \"review_date\", selectize=FALSE),\n  \n  shiny::selectInput(inputId = \"y_var\", \n                     label = \"Choose a variable for y axis\", \n                     choices = c(\"rating\"),\n                     selected  = \"rating\"),\n  \n  shiny::plotOutput(outputId = \"pair_plot\")\n)\n\n\nserver <- function(input, output){\n  output$pair_plot <- renderPlot({\n    \n    if(input$x_var == \"review_date\"){\n      ggplot(data  = NewChoco, aes(x = .data[[input$x_var]],\n                                   y = .data[[input$y_var]], \n                                   color = company)) + geom_point() +\n        facet_wrap(~ company, nrow = 2) + geom_line() +\n        theme(text = element_text(size=20)) + ggtitle(\n          \"Changes in the ratings of companies' chocolate bars (2006-2020)\") +\n        scale_x_continuous(breaks=seq(2005,2021,2), guide=guide_axis(angle=90))\n      \n    }else{\n      ggplot(data  = NewChoco, aes(x = .data[[input$x_var]],  \n                                   y = .data[[input$y_var]])) + geom_violin() +\n        geom_boxplot(width=0.1, fill=\"white\") +\n        theme(text = element_text(size=20)) +\n        ggtitle(\"A compact display of the rating deistribution of companies\")\n    }\n    \n  }, width = 1400, height = 800)\n}\n\n# Building the app\nshinyApp(ui = ui, server = server)\n","metadata":{"_kg_hide-output":true},"execution_count":null,"outputs":[]},{"cell_type":"markdown","source":"<a id=\"Feedback\" name=\"Feedback\"></a>\n# Feedback\n\nAny feedback or comment is highly appreciated.","metadata":{}}]}